    "overview": "Kralj Robert (Mark Addy) stie u Otrozimlje po svog novog Namjesnika, dugogodinjeg si prijatelja Neda (Sean Bean). Nedova obitelj poaena je kraljevim dolaskom no neki njeni lanovi nisu ni malo oduevljeni razdvajanjem koje ih eka. Naime, Bran (Isaac Hempstead Wright) je doivio nesreu pa e Catlyn (Michelle Fairley) ostati s njim u Otrozimlju, zajedno sa Robbom (Richard Madden) koji je sad najstariji Stark te malim Rickonom. Nedov vanbrani sin Jon Snow (Kit Harington) uputit e se na Zid koji Sedam kraljevina titi od zla i divljaka sa sjevera a s Nedom i kraljevskom povorkom otputovat e Nedove keri, Sansa (Sophie Turner) i Arya (Maisie Williams). Ipak, svatko od mladih Starkovih uz sebe e zadrat svojeg strahovuka koje su djeaci sluajno pronali u ranom snijegu. Dakle, Starkovi se razdvajaju ni ne slutei to ih sve eka.\n\nPreko mora, dva posljednja Targaryena, Daenerys (Emilia Clarke) i njen brat Viserys (Harry Llyod), prozvan Prosjakim kraljem, skrivaju se i bjee od Uzurpatorovih maeva. Viserys ima ambicije vratiti Sedam kraljevina koje su njegovom ocu oteli te, kako bi si osigurao vojsku, udaje svoju vrlo mladu sestru za monog konjskog kneza, khala Droga (Jason Momoa). Tree mjesto radnje je Zid gdje Jon shvaa da tamo nema plemenitih i asnih mueva ve bivi zloinci koji su izmeu tamnice i Zida radije odabrali zid, koliko god studen i opasan bio. Ipak, i meu njima e nai prijatelje.\n\n"
