   "data": {
    "name": "",
    "overview": "Kontinent, kde lta trvaj destky rok a zimy se mohou prothnout na cel lidsk ivot, zanaj suovat nepokoje. Vech Sedm krlovstv Zpadozem - pletichsk jih, divok vchodn krajiny i ledov sever ohranien starobylou Zd, kter chrn krlovstv ped proniknm temnoty - je zmtno bojem dvou mocnch rod na ivot a na smrt o nadvldu nad celou . Zem ots zrada, cht, intriky a nadpirozen sly. Krvav boj o elezn trn, post nejvyho vldce Sedmi krlovstv, bude mt nepedvdateln a dalekoshl dsledky... Vpravn seril HBO Hra o trny, podle bestsellerov fantasy sgy Pse ohn a ledu od George R. R. Martina, zachycuje soupeen o moc mezi krli a krlovnami, ryti a odpadlky, lhi a lechtici. Na potku pod krl Robert Baratheon, jeho ena Cersei pochz z rodu bohatch a bezohlednch Lannister, lorda Eddarda Starka, aby pijel na jih a pomohl mu spravovat krlovstv pot, co zhadn skonal jeho pobonk. Zrove trn z vchodu ohrouje dospvajc princezna Daenerys s bratrem Viserysem, jejich rod Targaryen vldl Zpadozem mnoho let pedtm, ne byl krvav sesazen. A proslch se tak, e se dj podivn vci na hranicch, severn od Zdi, kam odjd Jon Snow, Nedv nemanelsk syn, aby se stal lenem bratrstva, jen je zavzno psahou krlovstv chrnit."
