    "name": "",
    "overview": "Die fiktive Welt von Westeros, in der Jahreszeiten sich ber Jahre hinziehen: Sieben Knigreiche bevlkern den Kontinent, stndig gibt es Kriege, Machtkmpfe in den einzelnen Knigshusern, Morde und Intrigen. Im Zentrum dieser stndigen Machtverschiebungen stehen drei mchtige Adelshuser: Die Starks, die Lannisters und die Baratheons. Doch auch die vor Jahren abgesetzte und verbannte Knigsfamilie Targaryen plant ihre Rckkehr an die Macht. Die gefhrlichen Rnkespiele fhren schlielich zu einem Krieg, der den ganzen Kontinent destabilisiert, und weiteres Unheil zieht unbeobachtet auf: Jenseits des riesigen Eiswalls am nrdlichen Rand taucht eine unheimliche, Jahrhunderte alte Macht auf, deren Wirken frchterliche Folgen fr alle Einwohner von Westeros haben wird."
