    "overview": "Il Re dei Sette Regni di Westeros, Robert Baratheon, si reca a Grande Inverno, per chiedere al suo amico Ned Stark di accettare la carica di Primo Cavaliere. Inoltre il Re propone un matrimonio tra suo figlio Joffrey, erede al trono di spade e la figlia di Ned, Sansa. Da questo incontro prende il via una serie di eventi che porter Ned, Sansa e Arya ad Approdo del Re, mentre il resto della famiglia Stark rimane a Grande Inverno per controllare il territorio. I delicati equilibri politici si infrangono quando qualcuno cerca di far tacere definitivamente il piccolo Bran Stark, colpevole di aver scoperto un terribile segreto. Lady Catelyn Stark riceve conferma dei suoi sospetti e accusa i Lannister del misfatto, evento scatenante che dar il via a una serie di conflitti. Intanto al di l del Mare Stretto, Viserys Targaryen, figlio del Re Folle Aerys II, deposto da Robert Baratheon, d sua sorella Daenerys in sposa a Khal Drogo, un potente condottiero che gli promette un esercito per riappropriarsi del trono dei Sette Regni."
