   "english_name": "Polish",
   "data": {
    "name": "",
    "overview": "Siedem Krlestw Westeros to kraina przypominajca redniowieczn Europ,  w ktrej lato trwa przez dziesiciolecia, a zima moe panowa duej  ni yje czowiek. Dwie potne rodziny s uwikane w walk o wadz na  mier i ycie. Nie ma w niej miejsca na honor i lito. Zdrada,  podanie, intrygi i siy nadprzyrodzone wstrzsaj czteroma stronami  Krlestw, a zaarta walka o elazny Tron niesie ze sob nieprzewidywalne  konsekwencje.\r\nW serialu wystpuj Sean Bean (Wadca Piercieni, GoldenEye,  Equilibrium, Troja), nominowany do BAFTY Mark Addy (Goo i wesoo,  Obdny rycerz, Robin Hood), gwiazda serialu Terminator: Kroniki Sary  Connor - Lena Headey (Aberdeen, Nieustraszeni bracia Grimm, 300), Peter  Dinklage (Drnik, Zgon na pogrzebie, serial Bez skazy), Nicolaj  Coster-Waldau (Krlestwo niebieskie) oraz Emilia Clarke.  Zdjcia do  filmu powstay w Irlandii i na Malcie, a ich autorami s Matthew Jensen  (seriale Wzr i Czysta krew) oraz zdobywca nagrody Emmy Alik Sakharov  (seriale Rodzina Soprano i Rzym, Cena prawdy)."
   }
