   "data": {
    "biography": "William Bradley Pitt, dit Brad Pitt, est un acteur et producteur de cinma amricain n le 18 dcembre 1963  Shawnee (Oklahoma).\n\nRepr dans une publicit pour Levi's, Brad Pitt sort de l'anonymat grce  un petit rle dans le film Thelma et Louise de Ridley Scott. En trs peu de temps, il devient une vritable star et sa collaboration avec le ralisateur David Fincher donne naissance aux films cultes Seven, Fight Club et L'trange Histoire de Benjamin Button. Il tourne dans de nombreux autres succs comme Entretien avec un vampire de Neil Jordan, Ocean's Eleven et ses suites de Steven Soderbergh, Troie de Wolfgang Petersen, Inglourious Basterds de Quentin Tarantino et World War Z de Marc Forster. Au cours de sa carrire, il a reu quatre nominations aux Oscars et cinq nominations aux Golden Globes, dont un remport pour L'Arme des douze singes de Terry Gilliam en 1996.\n\nSex-symbol des annes 1990, Brad Pitt est le premier acteur lu deux fois  Homme le plus sexy du monde  par le magazine People en 1995 et en 2000. Avec sa femme Angelina Jolie (rencontre sur le tournage de Mr et Mrs Smith et qui a demand le divorce en septembre 2016), il est le pre de 6 enfants. Leur couple est trs mdiatis dans les annes 2000, y compris dans leurs actions humanitaires ( l'occasion notamment du tsunami de 2004 et de l'ouragan Katrina).\n\n partir de 2002, il s'investit dans la production via sa socit Plan B Entertainment avec des films tels que Les Infiltrs de Martin Scorsese et Twelve Years a Slave de Steve McQueen, qui ont chacun t rcompenss par l'Oscar du meilleur film en 2007 et 2014, The Tree of Life de Terrence Malick, qui a reu la Palme d'or au Festival de Cannes en 2011, ou des succs publics comme World War Z."
